import './css/footer.css'
import Logo from '../images/logo.png'

function Footer() {
    return (
        <div className='footer'>
            <img className='logo-1' src={Logo} alt='logo'/>
            ABC<br/>
            ABC
            <hr></hr>
            <a href='' className='foot-nav'></a>
        </div>
    );
}
export default Footer;
